paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 20000 ? 20000 : value));
            let normalizedValue = (value - 0) / (20000 - 0);

            {
                if (normalizedValue != 0.0) {
                    normalizedValue = rnbo_exp(((normalizedValue <= 0 ? 0 : rnbo_log(normalizedValue))) * 1. / 2);
                }
            }

            return normalizedValue;
        }
    default:
        index -= 2;

        if (index < this.poly[0].getNumParameters()) {
            {
                return this.poly[0].convertToNormalizedParameterValue(index, value);
            }
        }

        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                if (value == 0.0) {
                    return 0;
                } else {
                    return 0 + rnbo_exp(((value <= 0 ? 0 : rnbo_log(value))) * 2) * (20000 - 0);
                }
            }
        }
    default:
        index -= 2;

        if (index < this.poly[0].getNumParameters()) {
            {
                return this.poly[0].convertFromNormalizedParameterValue(index, value);
            }
        }

        return value;
    }
}

